// src/App.js
import React from 'react';
import TodoApp from './components/TodoApp';
import { AuthProvider } from './contexts/AuthContext';
import { ThemeProvider } from './contexts/ThemeContext';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <ThemeProvider>
        <div className="App">
          <TodoApp />
        </div>
      </ThemeProvider>
    </AuthProvider>
  );
}

export default App;
